import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import Navbar from '../components/navbar';
import Footer from '../components/footer';
import './eventDetail.css';

const EventDetail = () => {
  const { id } = useParams();
  const [showPopup, setShowPopup] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    email: '',
    address: '',
    city: '',
    country: '',
    zip: ''
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
    console.log('Form Data:', formData);
    setShowPopup(false);
  };

  const events = {
    1: {
      title: "Tech Conference 2023",
      date: "November 15-16, 2023",
      time: "9:00 AM - 5:00 PM",
      location: "San Francisco, CA",
      description: "Join us for the annual Tech Conference where industry leaders share insights on the latest trends and technologies.",
      agenda: [
        { time: "9:00 AM", title: "Registration & Breakfast" },
        { time: "10:00 AM", title: "Keynote: Future of Technology" },
        { time: "12:00 PM", title: "Lunch Break" },
        { time: "1:00 PM", title: "Panel: AI in Business" },
        { time: "3:00 PM", title: "Workshop: Cloud Computing" }
      ],
      image: "https://images.stockcake.com/public/a/7/a/a7acb612-27c9-469a-bb4f-92695cc7d178_large/tech-conference-presentation-stockcake.jpg",
      organizer: "Tech Events Inc.",
      organizerLogo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTYv-qZFL7Svj6edQQ9FXORZnbsBb4080JFiQ&s",
      price: "$199"
    },
    // ... other events
  };

  const event = events[id];

  return (
    <div className="event-detail-container">
      <Navbar />
      <main className="event-detail-content">
        {event ? (
          <>
            {/* Existing event details code... */}

            <div className="event-sidebar">
              <div className="event-actions">
                <button 
                  className="register-button" 
                  onClick={() => setShowPopup(true)}
                >
                  Register Now
                </button>
                <button className="share-button">Share Event</button>
              </div>
              <div className="event-price">
                <span>{event.price}</span>
              </div>
            </div>
          </>
        ) : (
          <p>Event not found.</p>
        )}
      </main>
      <Footer />

      {showPopup && (
        <div className="popup-overlay">
          <div className="registration-popup">
            <button 
              className="close-button" 
              onClick={() => setShowPopup(false)}
            >
              &times;
            </button>
            <h2>Register for {event?.title}</h2>
            <form onSubmit={handleSubmit}>
              <div className="form-group">
                <label>Name:</label>
                <input
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="form-group">
                <label>Phone Number:</label>
                <input
                  type="tel"
                  name="phone"
                  value={formData.phone}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="form-group">
                <label>Email ID:</label>
                <input
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="form-group">
                <label>Address:</label>
                <input
                  type="text"
                  name="address"
                  value={formData.address}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="form-group">
                <label>City:</label>
                <input
                  type="text"
                  name="city"
                  value={formData.city}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="form-group">
                <label>Country:</label>
                <input
                  type="text"
                  name="country"
                  value={formData.country}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <div className="form-group">
                <label>Zip Code:</label>
                <input
                  type="text"
                  name="zip"
                  value={formData.zip}
                  onChange={handleInputChange}
                  required
                />
              </div>
              <button type="submit" className="submit-button">
                Register
              </button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default EventDetail;
